import React from 'react';
import { dispatch } from 'rxjs/internal/observable/range';
import { bindActionCreators } from 'C:/Users/dudfh/AppData/Local/Microsoft/TypeScript/3.5/node_modules/redux';
import { ActionTypes } from '../../contants';
import { Actions } from '../../actions'
import { connect } from 'react-redux';

class userEdit extends React.Component{

    constructor(props){
        super(props)
        const { userdetails } = this.state.userdetails;
        this.state = {
            userdetails: []
        }
    }


    render(){
        const { userdetails } = this.props;
        console.log('현재의 state >>>>', this.state)
        console.log("현재의 props", this.props);
        return(
            <div>
                {userdetails.map((userdetail) =>(
                    <div>
                        <div>{userdetail.userId}</div>
                        <div>{userdetail.userRegday}</div>
                    </div>
                ))}
            </div>
        );
    }

}

function mapStateToProps(state) {
    const { user } = state;
    const { userdetails } = user;
    return {
        userdetails
    };
}//mapStateToProps

function mapDispatchToProps(dispatch) {
    return {
        getUserMe: bindActionCreators(Actions.getUserMe, dispatch)
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(userEdit);
